export default function ListNews({ articles, reload }) {
    return (
        <div className="ml-20 mr-20">
            <div className="grid grid-cols-2">
                <div>
                    <div className="sm:gap-5 mb-3">
                        <MainNews />
                    </div>
                    <hr className="border-gray-300 bg-gray-300" />
                    <div className="mt-5">
                        <SubNews />
                        <SubNews />
                        <SubNews />
                    </div>
                </div>
                <div className="mt-5">
                        <SubNews />
                        <SubNews />
                        <SubNews />
                    </div>
            </div>
            
        </div>
    )
}
